Приложение Kasta– это самый удобный и быстрый способ заказать вкуснейшие суши и бургеры! Устанавливайте приложение Kasta и получайте онлайн-доступ к нашему сервису доставки в любое время и в любом месте. 

Заказывайте доставку суши, бургеров на дом или берите с собой, посетив наши заведения. Просматривайте подробное меню с описаниями ингредиентов каждого блюда и прекрасными фото, читайте страницы Каста в социальных сетях и делитесь ими с друзьями.

Используя наше приложение, Вы можете:
- самостоятельно сформировать и оплатить заказ;
- выбрать удобный для Вас способ оплаты;
- установить время, в которое Вы бы хотели забрать заказ из нашего заведения; 
- установить время доставки заказа на дом;


Используя мобильное приложение Каста, Вы с легкостью можете заказать суши, бургеры, роллы, пиццу на любой вкус и размер. Также в нашем меню Вы найдете салаты, десерты, горячие закуски и не только. Доступные в приложении сортировка по цене, подробные описания и качественные фотографии блюд помогут Вам выбрать именно то, что Вы хотите. 


